                transform: rotateX(0) rotateY(0)
            }

            25% {
                transform: rotateX(180deg) rotateY(0)
            }

            50% {
                transform: rotateX(180deg) rotateY(180deg)
            }

            75% {
                transform: rotateX(360deg) rotateY(180deg)
            }

            100% {
                transform: rotateX(360deg) rotateY(360deg)
            }
        }

        @keyframes preloader {
            0% {
                transform: rotateX(0) rotateY(0)
            }

            25% {
                transform: rotateX(180deg) rotateY(0)
            }

            50% {
                transform: rotateX(180deg) rotateY(180deg)
            }

            75% {
                transform: rotateX(360deg) rotateY(180deg)
            }

            100% {
                transform: rotateX(360deg) rotateY(360deg)
            }
        }

        .v-enter-active,
        .v-leave-active {
            transition: opacity .5s ease
        }

        .v-enter-from,
        .v-leave-to {
            opacity: 0
        }

        .bork-notification {
            position: fixed;
            top: 0;
            left: 0;
            z-index: 9999;
            display: flex;
            flex-flow: row nowrap;
            align-items: center;
            justify-content: space-between;
            width: 100%;
            height: 60px;
            padding: 0 20px;
            color: #fff;
            background: #26211e;
            -webkit-animation: bork-slide-in .5s cubic-bezier(0.25, 0.46, 0.45, 0.94) both;
            animation: bork-slide-in .5s cubic-bezier(0.25, 0.46, 0.45, 0.94) both;
            box-sizing: border-box
        }

        @-webkit-keyframes bork-slide-in {
            0% {
                transform: translateY(-60px)
            }

            100% {
                transform: translateY(0)
            }
        }

        @keyframes bork-slide-in {
            0% {
                transform: translateY(-60px)
            }

            100% {
                transform: translateY(0)
            }
        }

        .bork-notification__content {
            flex-grow: 1;
            padding: 5px;
            font-size: 18px;
            font-family: "Akzidenz", Helvetica, Arial, sans-serif;
            text-align: center;
            border-radius: 2px
        }

        .bork-search {
            display: flex;
            flex-direction: column;
            align-items: center;
            box-sizing: border-box;
            width: 100%;
            margin-top: 40px;
            padding: 0 30px;
            -webkit-animation: bork-fadeIn;
            animation: bork-fadeIn
        }

        @-webkit-keyframes bork-fadeIn {
            from {
                opacity: 0
            }

            to {
                opacity: 1
            }
        }

        @keyframes bork-fadeIn {
            from {
                opacity: 0
            }

            to {
                opacity: 1
            }
        }

        @media screen and (max-width: 979px) {
            .bork-search {
                height: -webkit-fit-content;
                height: -moz-fit-content;
                height: fit-content;
                padding: 0;
                margin-top: 0;
                height: 100%
            }
        }

        @media screen and (max-width: 767px) {
            .bork-search {
                height: -webkit-fit-content;
                height: -moz-fit-content;
                height: fit-content;
                padding-bottom: 30px;
                min-height: 100vh
            }
        }

        .bork-search__close {
            position: fixed;
            top: 20px;
            right: 20px;
            z-index: 10
        }

        .bork-search__content-wrapper {
            position: fixed;
            top: -50px;
            transition: all .3s ease-out;
            height: 50px;
            width: 850px;
            background-color: #3a3330;
            border-radius: 28px 28px 12px 12px;
            overflow: hidden
        }

        @media screen and (max-width: 979px) {
            .bork-search__content-wrapper {
                position: static;
                top: auto;
                width: 100%;
                display: flex;
                flex-direction: column;
                align-items: center;
                border-radius: 0;
                max-height: none;
                height: 100%;
                overflow: visible
            }
        }

        @media screen and (max-width: 767px) {
            .bork-search__content-wrapper {
                width: 100%;
                height: auto
            }
        }

        .bork-search__content-wrapper--no-suggestions {
            background-color: transparent
        }

        .bork-search__content-wrapper--visible {
            top: 50px;
            height: 621px
        }

        @media screen and (max-width: 979px) {
            .bork-search__content-wrapper--visible {
                max-height: none;
                height: 100%
            }
        }

        .bork-search__container {
            width: 850px
        }

        @media screen and (max-width: 979px) {
            .bork-search__container {
                width: 640px;
                margin-top: 10px
            }
        }

        @media screen and (max-width: 767px) {
            .bork-search__container {
                width: 100%
            }
        }

        .bork-search__body--loading {
            margin-top: -45px
        }

        .bork-search__search-header {
            margin-bottom: 10px;
            transition: all .3s ease-out
        }

        @media screen and (max-width: 479px) {
            .bork-search__search-header {
                margin-bottom: 18px;
                padding: 0 16px
            }
        }

        @media screen and (max-width: 979px) {
            .bork-search__search-header {
                position: relative;
                top: -80px
            }
        }

        @media screen and (max-width: 979px) {
            .bork-search__search-header--visible {
                padding-top: 10px;
                top: 0
            }
        }

        .bork-search__skeleton {
            padding: 25px 30px 30px
        }

        @media screen and (max-width: 979px) {
            .bork-search__skeleton {
                padding: 0 16px
            }
        }

        .bork-search__search-dialog .el-dialog {
            overflow: visible
        }

        @media screen and (max-width: 979px) {
            .bork-search__search-dialog .el-dialog {
                height: 100%
            }
        }

        @media screen and (max-width: 979px) {
            .bork-search__search-dialog .el-dialog__body {
                height: 100%
            }
        }

