        .bork-refurbished-product__title {
            font-weight: 400;
            font-size: 16px;
            font-family: "akzidenz-extended", sans-serif;
            line-height: 22px;
            letter-spacing: .2px;
            -webkit-font-smoothing: antialiased;
            color: #fff
        }

        .bork-refurbished-product__separator {
            margin: 18px 0 24px
        }

        .bork-refurbished-product__footer {
            display: flex;
            align-items: center;
            justify-content: center;
            width: 100%;
            height: 74px;
            margin-top: 24px;
            background-color: rgba(0, 0, 0, .5);
            border-radius: 0 0 12px 12px
        }

        .bork-header-modern {
            display: block;
            position: fixed;
            height: 60px;
            background-color: var(--header-bg-color);
            top: auto;
            width: 100%;
            left: 0;
            z-index: 999;
            transition: all 200ms ease;
            -webkit-backdrop-filter: blur(5px);
            backdrop-filter: blur(5px)
        }

        .bork-header-modern--transparent {
            -webkit-backdrop-filter: none;
            backdrop-filter: none;
            background-color: unset;
            background: linear-gradient(180deg, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0) 100%)
        }

        .bork-header-modern--upper-layer {
            z-index: 2001
        }

        @media screen and (min-width: 1201px) {
            .bork-header-modern {
                height: 122px
            }

            .bork-header-modern--horizontal-menu-disabled {
                height: 60px
            }

            .bork-header-modern--invisible-horizontal-menu {
                height: 60px
            }
        }

        @media screen and (max-width: 768px) {
            .bork-header-modern {
                height: 60px
            }
        }

        .bork-header-modern--invisible-horizontal-menu {
            height: 60px
        }

        .bork-header-modern--has-hover .bork-header-modern__top,
        .bork-header-modern--has-hover .bork-header-modern__horizontal-menu {
            background: var(--header-bg-hover-color)
        }

        .bork-header-modern--is-hidden {
            height: 0
        }

        .bork-header-modern__lock-overlay {
            display: block;
            position: fixed;
            height: 60px;
            background-color: transparent;
            top: auto;
            width: 100%;
            left: 0;
            z-index: 1000
        }

        .bork-header-modern__top {
            position: fixed;
            top: auto;
            right: 0;
            left: 0;
            z-index: 999;
            display: flex;
            justify-content: space-between;
            align-items: center;
            min-width: 320px;
            height: 60px
        }

        .bork-header-modern__top--absolute {
            position: absolute
        }

        @media screen and (max-width: 768px) {
            .bork-header-modern__top {
                height: 60px
            }
        }

        .bork-header-modern__menu {
            opacity: 0;
            position: fixed;
            top: 0;
            right: 0;
            bottom: 0;
            left: 0;
            background-color: rgba(0, 0, 0, .5);
            transition: opacity .3s ease;
            height: 100vh;
            height: 100dvh;
            z-index: 999
        }

        .bork-header-modern__menu--opened {
            opacity: 1
        }

        .bork-header-modern__menu--closed {
            display: none
        }

        .bork-header-modern__menu-catalog {
            position: absolute;
            top: 0;
            bottom: 0;
            left: 0;
            width: 400px;
            height: 100vh;
            height: 100dvh;
            transform: translateX(-100%);
            transition: transform .3s ease
        }

        .bork-header-modern__menu-catalog--opened {
            transform: translateX(0)
        }

        .bork-header-modern__menu-catalog--closed {
            display: none
        }

        @media screen and (max-width: 768px) {
            .bork-header-modern__menu-catalog {
                width: 100%
            }
        }

        .bork-header-modern__menu-personal {
            position: absolute;
            top: 0;
            right: 0;
            bottom: 0;
            width: 430px;
            height: 100vh;
            height: 100dvh;
            background-color: #2e2826;
            transform: translateX(100%);
            transition: transform .3s ease
        }

        .bork-header-modern__menu-personal--opened {
            transform: translateX(0)
        }

        .bork-header-modern__menu-personal--closed {
