            text-transform: none;
            text-decoration: none
        }

        .bork-submenu__item:last-child {
            margin-bottom: 0
        }

        .bork-submenu__item::after {
            display: block;
            width: 0%;
            height: 1px;
            background-color: #f37021;
            transition: width .5s;
            content: ""
        }

        .bork-submenu__item:hover::after {
            width: 100%
        }
