    <style type="text/css">
        .ui-qr {
            width: var(--width);
            height: var(--height)
        }
    </style>
    <style type="text/css">
        @font-face {
            font-family: "bork";
            src: url(/_nuxt/fonts/530e06d.woff2) format("woff2"), url(/_nuxt/fonts/09e768e.woff) format("woff")
        }

        @font-face {
            font-family: "akzidenz-extended";
            src: url(/_nuxt/fonts/0d8421e.woff2) format("woff2"), url(/_nuxt/fonts/5e4ee03.woff) format("woff")
        }

        @font-face {
            font-family: "Akzidenz-Grotesk Pro Medium Extended";
            src: url(/_nuxt/fonts/b0462af.woff2) format("woff2"), url(/_nuxt/fonts/eec6383.woff) format("woff")
        }

        @font-face {
            font-family: "helvetica";
            src: url(/_nuxt/fonts/d59df5a.woff2) format("woff2"), url(/_nuxt/fonts/0247694.woff) format("woff")
        }

        @font-face {
            font-family: "helvetica-medium";
            src: url(/_nuxt/fonts/751c19b.woff2) format("woff2"), url(/_nuxt/fonts/1c5a4d4.woff) format("woff")
        }

        @font-face {
            font-family: "Roboto-Bork";
            src: url(/_nuxt/fonts/6cd35ed.woff2) format("woff2")
        }

        .ui-app-qr {
            position: relative
        }

        .ui-app-qr__qr-canvas {
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 8px;
            background-color: #fff;
            border-radius: 5px
        }

        .ui-app-qr--is-mobile .ui-app-qr__links {
            margin-left: 0
        }

        .ui-app-qr--is-mobile .ui-app-qr__description {
            display: flex;
            align-items: center;
            width: 167px;
            margin-left: 14px;
            padding-top: 3px;
            color: #fff;
            font-weight: 400;
            font-size: 14px;
            font-family: "helvetica", sans-serif;
            line-height: 18px;
            letter-spacing: .2px;
            -webkit-font-smoothing: antialiased
        }

        .ui-app-qr--is-mobile .ui-app-qr__description--light {
            color: #000
        }

        .ui-app-qr--view--default {
            position: relative
        }

        .ui-app-qr--view--default .ui-app-qr__wrapper {
            display: flex;
            align-items: stretch
        }

        .ui-app-qr--view--default .ui-app-qr__content {
            margin-right: 24px
        }

        .ui-app-qr--view--default .ui-app-qr__links {
            display: flex;
            flex-direction: column;
            gap: 18px;
            justify-content: space-between
        }

        .ui-app-qr--view--alt {
            position: relative
        }

        .ui-app-qr--view--alt .ui-app-qr__wrapper {
            display: inline-flex;
            flex-direction: column
        }

        .ui-app-qr--view--alt .ui-app-qr__content {
            display: flex;
            align-items: center;
            justify-content: space-between;
            width: 100%
        }

        .ui-app-qr--view--alt .ui-app-qr__title {
            font-weight: 400;
            font-size: 16px;
            font-family: "akzidenz-extended", sans-serif;
            line-height: 22px;
            letter-spacing: .2px;
            -webkit-font-smoothing: antialiased;
            width: 130px;
            color: #fff
        }

        .ui-app-qr--view--alt .ui-app-qr__links {
            display: flex;
            flex-direction: row-reverse;
            margin-top: 24px
        }

        .ui-app-qr--view--alt .ui-app-qr__link:not(:last-child) {
            margin-left: 18px
        }

        .ui-app-qr__icon {
            width: 140px;
            height: 40px
        }
    </style>
    <style type="text/css">
        @-webkit-keyframes ui-ui-shake {

            from,
            to {
                transform: translate3d(0, 0, 0)
            }

            10%,
            30%,
            50%,
            70%,
            90% {
                transform: translate3d(-10px, 0, 0)
            }

            20%,
            40%,
            60%,
            80% {
                transform: translate3d(10px, 0, 0)
            }
        }

        @keyframes ui-ui-shake {

            from,
            to {
                transform: translate3d(0, 0, 0)
            }

            10%,
            30%,
            50%,
            70%,
            90% {
                transform: translate3d(-10px, 0, 0)
            }

            20%,
            40%,
            60%,
            80% {
                transform: translate3d(10px, 0, 0)
            }
        }

