        background-color: #3a3330;
        border-radius: 12px
    }

    .el-dialog.is-fullscreen {
        max-width: none;
        margin: 0 !important;
        border-radius: 0;
        box-shadow: none
    }

    .el-dialog__wrapper {
        position: fixed;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        margin: 0;
        padding: 10px;
        overflow: auto
    }

