    }

    .preloader--after:after,
    .preloader--before:before {
        position: absolute;
        top: -50%;
        right: -50%;
        bottom: -50%;
        left: -50%;
        z-index: 100;
        display: inline-block;
        width: 95px;
        height: 95px;
        margin: auto;
        background-image: url(//st.bork.ru/images/preloader/square2.svg);
        background-repeat: no-repeat;
        background-position: 0;
        background-size: auto 100%;
        content: ""
    }

