    .el-icon-loading {
        -webkit-animation: rotating 2s linear infinite;
        animation: rotating 2s linear infinite
    }

    .el-icon--right {
        margin-left: 5px
    }

    .el-icon--left {
        margin-right: 5px
    }

    @-webkit-keyframes rotating {
        0% {
            -webkit-transform: rotateZ(0);
            transform: rotateZ(0)
        }

        100% {
            -webkit-transform: rotateZ(360deg);
            transform: rotateZ(360deg)
        }
    }

    @keyframes rotating {
        0% {
            -webkit-transform: rotateZ(0);
            transform: rotateZ(0)
        }

        100% {
            -webkit-transform: rotateZ(360deg);
            transform: rotateZ(360deg)
        }
    }

    .el-loading-parent--relative {
        position: relative !important
    }

    .el-loading-parent--hidden {
        overflow: hidden !important
    }

    .el-loading-mask {
        position: absolute;
        z-index: 2000;
        background-color: rgba(255, 255, 255, .9);
        margin: 0;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        -webkit-transition: opacity .3s;
        transition: opacity .3s
    }

    .el-loading-mask.is-fullscreen {
        position: fixed
    }

    .el-loading-mask.is-fullscreen .el-loading-spinner {
        margin-top: -25px
    }

    .el-loading-mask.is-fullscreen .el-loading-spinner .circular {
        height: 50px;
        width: 50px
    }

    .el-loading-spinner {
        top: 50%;
        margin-top: -21px;
        width: 100%;
        text-align: center;
        position: absolute
    }

    .el-loading-spinner .el-loading-text {
        color: #409EFF;
        margin: 3px 0;
        font-size: 14px
    }

    .el-loading-spinner .circular {
        height: 42px;
        width: 42px;
        -webkit-animation: loading-rotate 2s linear infinite;
        animation: loading-rotate 2s linear infinite
    }

    .el-loading-spinner .path {
        -webkit-animation: loading-dash 1.5s ease-in-out infinite;
        animation: loading-dash 1.5s ease-in-out infinite;
        stroke-dasharray: 90, 150;
        stroke-dashoffset: 0;
        stroke-width: 2;
        stroke: #409EFF;
        stroke-linecap: round
    }

    .el-loading-spinner i {
        color: #409EFF
    }

    .el-loading-fade-enter,
    .el-loading-fade-leave-active {
        opacity: 0
    }

    @-webkit-keyframes loading-rotate {
        100% {
            -webkit-transform: rotate(360deg);
            transform: rotate(360deg)
        }
    }

    @keyframes loading-rotate {
        100% {
            -webkit-transform: rotate(360deg);
            transform: rotate(360deg)
        }
    }

    @-webkit-keyframes loading-dash {
        0% {
            stroke-dasharray: 1, 200;
            stroke-dashoffset: 0
        }

        50% {
            stroke-dasharray: 90, 150;
            stroke-dashoffset: -40px
        }

        100% {
            stroke-dasharray: 90, 150;
            stroke-dashoffset: -120px
        }
    }

    @keyframes loading-dash {
        0% {
            stroke-dasharray: 1, 200;
            stroke-dashoffset: 0
        }

        50% {
            stroke-dasharray: 90, 150;
            stroke-dashoffset: -40px
        }

        100% {
            stroke-dasharray: 90, 150;
            stroke-dashoffset: -120px
        }
    }

    .el-loading-mask {
        overflow: hidden;
        background-color: #3a3330 !important;
        border-radius: 12px;
        transition: none
    }

    .el-loading-spinner {
        position: relative;
        margin-top: auto;
        opacity: 1;
        transition: opacity .3s
    }

    .el-loading-spinner::before {
        position: absolute;
        top: -50%;
        right: -50%;
        bottom: -50%;
        left: -50%;
        z-index: 100;
        display: inline-block;
        width: 95px;
        height: 95px;
        margin: auto;
        background-image: url("//st.bork.ru/images/preloader/square2.svg");
        background-repeat: no-repeat;
        background-position: left center;
        background-size: auto 100%;
        animation: preloader-square 1s steps(11) infinite;
        content: ""
    }

    .el-loading-spinner * {
        display: none
    }

    @keyframes preloader-square {
        100% {
            background-position-x: calc(95px * 11 * -1)
        }
    }

    .el-loading-fade-leave-active {
        transition: opacity .3s
    }

    .el-loading-fade-leave-active .el-loading-spinner {
        display: none
    }

    [class*=el-loading-parent]>:not(.el-loading-mask) {
        opacity: 0
    }

    .wrapper {
        position: relative;
        height: -webkit-fit-content;
        height: -moz-fit-content;
        height: fit-content
    }

    .wrapper.banner-shown .header-modern,
    .wrapper.banner-shown .header-modern__menu,
    .wrapper.banner-shown .location-confirm {
        top: 60px
    }

    .wrapper.banner-shown .page-content {
        margin-top: 60px
    }

    .wrapper.banner-shown .boutique-list {
