    .bork-horizontal-menu {
        width: 100%;
        background-color: inherit
    }

    .bork-horizontal-menu__wrap {
        position: relative;
        display: flex;
        justify-content: center;
        z-index: 20;
        background-color: inherit
    }

    .bork-horizontal-menu__menu {
        font-weight: 400;
        font-size: 16px;
        font-family: "helvetica", sans-serif;
        line-height: 22px;
        letter-spacing: 0;
        -webkit-font-smoothing: antialiased;
        display: flex;
        align-items: center;
        justify-content: center;
        max-width: 1200px;
        margin: 0;
        padding: 0 20px;
        letter-spacing: 1.3px;
        transition: all .5s
    }

    .bork-horizontal-menu__menu--active .bork-horizontal-menu__menu-title {
        color: #9d9390
    }

    .bork-horizontal-menu__menu-item {
        text-transform: uppercase;
        cursor: pointer
    }

    .bork-horizontal-menu__menu-item:first-child {
        padding-left: 0
    }

    .bork-horizontal-menu__menu-item--active .bork-horizontal-menu__menu-title {
        color: var(--horizontal-menu-font-hover-color)
    }

    .bork-horizontal-menu__menu-title {
        display: block;
        margin-top: 4px;
        color: #fff;
        text-decoration: none;
        list-style-type: none;
        display: block;
        color: var(--horizontal-menu-font-color);
        padding: 0 14px;
        margin: 20px 0 19px 0
    }

    .bork-horizontal-menu__menu-title::after {
        position: relative;
        bottom: -4px;
        display: block;
        height: 1px;
        background-color: #f37021;
        transition: width .5s;
        content: "";
        right: 0;
        width: 0
    }

    .bork-horizontal-menu__menu-title--active::after {
        position: relative;
        bottom: -4px;
        display: block;
        height: 1px;
        background-color: #f37021;
        transition: width .5s;
        content: "";
        left: 0;
        width: 100%
    }

    .bork-horizontal-menu__dropdown-menu {
        transition: all 350ms ease-out, opacity 0s;
        transform: translateY(calc(-100% - 124px));
        position: absolute;
        left: 0;
        top: 100%;
        right: 0;
        z-index: 10;
        background-color: var(--header-bg-hover-color)
    }

    .bork-horizontal-menu__dropdown-menu--focus {
        transform: translateY(0)
    }

    .bork-horizontal-menu__background {
        position: absolute;
        box-sizing: border-box;
        width: 100%;
        height: 100vh;
        background: rgba(0, 0, 0, .6);
        -webkit-backdrop-filter: blur(30px);
        backdrop-filter: blur(30px)
    }

    .dropdown-menu-enter {
        transform: translateY(-20px);
        opacity: 0
    }

    .dropdown-menu-leave-to {
        opacity: 0
    }

    .dropdown-menu-enter-active,
    .dropdown-menu-leave-active {
        transition: transform 200ms ease-out, opacity 200ms ease-in
    }

    .menu-background-enter,
    .menu-background-leave-to {
        opacity: 0
    }

    .menu-background-enter-active,
    .menu-background-leave-active {
        transition: all 350ms ease-out
    }

    .bork-dropdown-menu {
        display: flex;
        justify-content: center;
        width: 100%;
        min-height: 649px;
        background: var(--header-bg-hover-color)
    }

    .bork-dropdown-menu--old-version {
        min-height: 548px
    }

    .bork-dropdown-menu__wrapper {
        display: flex;
        justify-content: center;
        padding-top: 24px;
        padding-bottom: 45px;
        width: 1280px
    }

    .bork-dropdown-menu__img {
        width: 500px;
        height: 445px;
        -o-object-fit: cover;
        object-fit: cover;
        border-radius: 10px;
        margin-left: 80px
    }

    .bork-dropdown-menu__list {
        display: flex;
        margin: 0;
        padding: 0
    }

    .bork-dropdown-menu__list--view--standard>li:not(:last-child) {
        margin-right: 80px
    }

    .bork-dropdown-menu__list--view--compressed>li:not(:last-child) {
        margin-right: 20px
    }

    @media screen and (min-width: 1600px) {
        .bork-dropdown-menu__list--view--compressed>li:not(:last-child) {
            margin-right: 80px
        }
    }

    .bork-dropdown-menu__list--view--compressed>li:last-child {
        width: 200px
    }

    .bork-dropdown-menu__item {
        color: #fff;
        list-style-type: none
    }

    .bork-dropdown-menu__item--view--standard {
        width: 260px
    }

    .bork-dropdown-menu__item--view--compressed {
