жно задать персональным консультантам по телефону 8 916 182 92 72 (звонок бесплатный). Доставка техники осуществляется по всей России бесплатно.\u003C\u002Fp\u003E", ADDITIONAL_TEXT: b, ANCHORS: b, HIDE: "Свернуть", MORE: "Узнайте больше", ACTIVE: aS, USE_H1: c, TEXT_ADDITIONAL: b, TEXT_ADDITIONAL_APPEND: "С полным списком адресов магазинов BORK и режимом работы вы можете ознакомиться на странице \u003Ca href=\"\u002Fsupport\u002Fpickup\u002F\"\u003E«Бутики»\u003C\u002Fa\u003E.", QR_CODE: g$, QR_APP_STORE: ha, QR_GOOGLE_PLAY: hb, AF_PARAMS: "{\"oneLinkURL\":\"https:\\\u002F\\\u002Fbork.onelink.me\\\u002FANes\",\"afParameters\":{\"mediaSource\":{\"keys\":[\"utm_source\"],\"defaultValue\":\"yandex\"},\"campaign\":{\"keys\":[\"utm_campaign\"],\"defaultValue\":\"RU_shop_gen_obshie_vendor_msk_poisk|62433499\"},\"deepLinkValue\":{\"keys\":[\"bork_dlv\"],\"defaultValue\":\"https%3A%2F%2Fwww.bork.ru\"},\"adSet\":{\"keys\":[\"af_adset\"],\"defaultValue\":\"footer\"},\"channel\":{\"keys\":[\"bork_channel\"],\"defaultValue\":\"QR_code\"},\"afCustom\":[{\"paramKey\":\"af_dp\",\"keys\":[\"bork_dp\"],\"defaultValue\":\"bork%3A%2F%2Fwww.bork.ru\"},{\"paramKey\":\"af_ss_ui\",\"defaultValue\":\"true\"},{\"paramKey\":\"af_ss_gtm_ui\",\"defaultValue\":\"true\"}]}}" }, footerCards: [{ url: aE, target: x, title: dc }, { url: "\u002Fsupport\u002Fhotline\u002F", target: x, title: "Служба заботы" }, { url: cR, target: x, title: "Сервис" }, { url: dd, target: x, title: de }], footer: { additionalClass: b, menuCatalog: [{ HREF: bj, SITE_MAP: a, TITLE: q, TARGET: x, CLASS: b, SHOW: c }, { HREF: "\u002FeShop\u002FHome-and-Climate\u002F", SITE_MAP: a, TITLE: y, TARGET: x, CLASS: b, SHOW: c }, { HREF: cT, SITE_MAP: a, TITLE: r, TARGET: x, CLASS: b, SHOW: c }, { HREF: "\u002FeShop\u002Faccessories\u002F", SITE_MAP: a, TITLE: "Аксессуары", TARGET: x, CLASS: b, SHOW: c }, { HREF: "\u002Fpages\u002F", TITLE: "Советы по выбору", TARGET: x, CLASS: b, SHOW: c }, { HREF: "\u002FeShop\u002Farchive\u002F"